(function($) {
$(document).ready(function(){

	//CarouFredSel
	$('#salon-carousel').carouFredSel({
		items: 4,
		circular: true,
	    infinite: false,
		width: 540,
		height: 304,
		auto: false,
		prev	: {	
			button	: "#salon-prev",
			key		: "left"
		},
		next	: { 
			button	: "#salon-next",
			key		: "right"
		},
		scroll : {
			items			: 1,						
			pauseOnHover	: true
		},
		swipe: true,
		mousewheel: true
	});
	$('#model-carousel').carouFredSel({
		items: 3,
		circular: true,
	    infinite: false,
		width: 540,
		height: 540,
		auto: false,
		prev	: {	
			button	: "#model-prev",
			key		: "left"
		},
		next	: { 
			button	: "#model-next",
			key		: "right"
		},
		scroll : {
			items			: 1,						
			pauseOnHover	: true
		},
		swipe: true,
		mousewheel: true
	});
	$('#new-model-carousel').carouFredSel({
		items: 3,
		circular: true,
	    infinite: false,
		width: 540,
		height: 250,
		auto: false,
		prev	: {	
			button	: "#new-model-prev",
			key		: "left"
		},
		next	: { 
			button	: "#new-model-next",
			key		: "right"
		},
		scroll : {
			items			: 1,						
			pauseOnHover	: true
		},
		swipe: true,
		mousewheel: true
	});
	$('#new-salon-carousel').carouFredSel({
		items: 4,
		circular: true,
	    infinite: false,
		width: 540,
		height: 152,
		auto: false,
		prev	: {	
			button	: "#new-salon-prev",
			key		: "left"
		},
		next	: { 
			button	: "#new-salon-next",
			key		: "right"
		},
		scroll : {
			items			: 1,						
			pauseOnHover	: true
		},
		swipe: true,
		mousewheel: true
	});
	

	$(".salons > ul > li a").on("click", function(e){
		e.preventDefault();
		if ( $(this).hasClass("clicked") ) {
			$(this).next().slideUp();
			$(this).removeClass("clicked");
		} else {
			$(this).next().slideDown();
			$(this).addClass("clicked");
		}		
	});
	
});
})(jQuery);	